import React from 'react';
import Cards from './Cards';

function Cardslist(props) {
    const cards = props.posters.map((obj, idx) => (
        <li key={idx} className="cards-list__item">
            <Cards img={obj.image} alt={obj.title || `Poster ${idx + 1}`} />
        </li>
    ));

    return (
        <section className="cards-list" aria-label="Poster gallery">
            <ul className="cards-list__grid">{cards}</ul>
        </section>
    );
}

export default Cardslist;
